INSERT INTO `event_navi_comment` VALUES (/*comment_id*/53003, /*where_type*/53, /*character_id*/190801, /*face_type*/1, /*character_name*/"カリン", /*description*/"ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", /*voice_id*/1, /*start_time*/"2019/08/31 12:00:00", /*end_time*/"2030/01/01 14:59:59", /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/3.414, /*change_face_type*/2, /*event_id*/0);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/53004, /*where_type*/53, /*character_id*/190801, /*face_type*/1, /*character_name*/"カリン", /*description*/"ミッションをクリアして、\n報酬をゲットしましょう！", /*voice_id*/2, /*start_time*/"2019/08/31 12:00:00", /*end_time*/"2030/01/01 14:59:59", /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/3.099, /*change_face_type*/2, /*event_id*/0);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/54003, /*where_type*/54, /*character_id*/190801, /*face_type*/1, /*character_name*/"カリン", /*description*/"受け取ることができる\n報酬があるようです\n確認してみてください", /*voice_id*/3, /*start_time*/"2019/08/31 12:00:00", /*end_time*/"2030/01/01 14:59:59", /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/2.801, /*change_face_type*/2, /*event_id*/0);
